import React from "react";
import "../App.css";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import logo from "../images/hand-book-logo-illustration-art-background-43965136.webp";
import { useNavigate } from "react-router-dom";
import Footer from "./Footer";

const Home = () => {
  const navigate = useNavigate();

  const NavigateToMainPage = () => {
    navigate("/allbooks");
  };

  return (
    <div className="home">
      <img className="homeLogo" src={logo} alt="library logo" />
      <div className="homeFirstDiv">
        <h1>WELCOME TO LIBRARY</h1>
        <div className="homeFirstDiv_childFirstDiv">
          <div className="textfield">
            <TextField fullWidth label="Email" id="fullWidth" />
          </div>
          <div className="textfield">
            <TextField
              fullWidth
              label="Password"
              type="password"
              id="fullWidth"
            />
          </div>
        </div>
        <Button
          onClick={NavigateToMainPage}
          fullWidth
          className="btn_In"
          variant="contained"
        >
          Sign-In
        </Button>
        <p className="or">Forgate Password ?</p>
      </div>
    </div>
  );
};

export default Home;
